import React from 'react'
import { Row, Col, Card, Table } from 'antd';

function ExistingData() {

    const clientColumns = [
        {
            title: 'Name',
            dataIndex: 'name',
            key: 'name',
        }
    ]

    const clientData = [
        { key: '1', name: 'AXIS Bank'}, { key: '2', name: 'ICICI Bank'}, { key: '3', name: 'RBL Bank'}, { key: '4', name: 'TVS'}, { key: '5', name: 'SBI Bank'}, { key: '6', name: 'IDFC Bank'}, { key: '7', name: 'Bajaj Auto Finance'}, { key: '8', name: 'TCL'}, { key: '9', name: 'CBD'}, { key: '10', name: 'ENBD'}, { key: '11', name: 'TCHFL'}, { key: '12', name: 'Kotak Mahindra'}, { key: '13', name: 'Avanse'}
    ]

    const languageData = [
        { key: '1', name: 'English'}, { key: '2', name: 'Hindi'}, { key: '3', name: 'Tamil'}, { key: '4', name: 'Telugu'}, { key: '5', name: 'Kannada'}, { key: '6', name: 'Marathi'}, { key: '7', name: 'Gujarati'}, { key: '8', name: 'Bengali'}, { key: '9', name: 'Punjabi'}, { key: '10', name: 'Malayalam'}
    ]

    const productData = [
        { key: '1', name: 'Loan'}, { key: '2', name: 'Credit Card'}, { key: '3', name: 'MFI'}, { key: '4', name: 'EMI On Debit Card'}, { key: '5', name: 'Agri Loan'}, { key: '6', name: 'Tractor Loan'}, { key: '7', name: 'CD-SNC'}, { key: '8', name: 'Common Borrowers'}, { key: '9', name: 'Pay Later'}
    ]

    const segmentData = [{ key: '1', name: 'Pre-Due'}, { key: '2', name: 'Post-Due'}, { key: '3', name: 'Bucket X' }, { key: '4', name: 'NPA'}, { key: '5', name: 'W/Off'}, { key: '6', name: 'Phase 1'}, { key: '7', name: 'Phase 2'}, { key: '8', name: 'Phase 3'} , {key: '9', name: 'Phase 4(Pre 90)'}, {key: '10', name: 'Phase 4 (90+)'}]


    const stageData = [{key: '1', name: 'Delay'}, { key: '1', name: 'Default'}]

    const typeData = [
        { key: '1', name: 'Reminder'}, { key: '2', name: 'Impact'}, { key: '3', name: 'Legal' }, { key: '4', name: 'Follow up'}, { key: '5', name: 'Relationship'}, { key: '6', name: 'Action'}, { key: '7', name: 'Urgency'}
    ]

    const categoryData = [{ key: '1', name: 'Basic'}, { key: '2', name :'Detailed' }, { key: '3', name :'Urgency' }, { key: '4', name :'Charges' }, { key: '5', name :'Clean Track' }, { key: '6', name :'Good' }, { key: '7', name :'CIBIL' }, { key: '8', name :'Credit' }, { key: '9', name :'Action' }, { key: '10', name :'NC_1' }, { key: '11', name :'NC_2' }, { key: '12', name :'Awareness' }, { key: '13', name :'Soft Reminder' }, { key: '14', name :'Collection Reminder' }, { key: '15', name :'Impact Reminder 1' }, { key: '16', name :'Impact Reminder 2' }, { key: '17', name :'Good Order' }, { key: '18', name :'Long Lasting' }, { key: '19', name :'Relationship Status' }, { key: '20', name :'Avoid Action' }, { key: '21', name :'Action To Be Initiated' }, { key: '22', name :'Action Initiated' }, { key: '23', name :'Degradation Of Account' }, { key: '24', name :'Lgeal Inbound' }, { key: '26', name :'Legal' }, { key: '27', name :'Reminder' }, { key: '28', name :'PTP Reminder' }, { key: '29', name :'Broken PTP' }, { key: '30', name :'Default' }, { key: '31', name :'Delinquent' }, { key: '32', name :'Legal Reminder' }, { key: '33', name :'Legal Action' }, { key: '34', name :'Good Order' }, { key: '35', name :'Long Lasting' }, { key: '36', name :'Relationship Status' }, { key: '37', name :'Degradation Of Account' }, { key: '38', name :'Legal To Be Initiated' }, { key: '39', name :'Other' }, { key: '40', name :'Reacted' }, { key: '41', name :'Reaction' }]

    const ClientTable = () => (
        <Card title="Clients">
            <Table
                pagination={{ pageSize: 3 }}
                columns={clientColumns} 
                dataSource={clientData} 
                rowKey='id'
            />
        </Card>
    ) 

    const LanguageTable = () => (
        <Card title="Languages">
            <Table
                pagination={{ pageSize: 3 }}
                columns={clientColumns} 
                dataSource={languageData} 
                rowKey='id'
            />
        </Card>
    )
    const ProductTable = () => (
        <Card title="Products">
            <Table
                pagination={{ pageSize: 3 }}
                columns={clientColumns} 
                dataSource={productData} 
                rowKey='id'
            />
        </Card>
    )
    const SegmentTable = () => (
        <Card title="Segments">
            <Table
                pagination={{ pageSize: 3 }}
                columns={clientColumns} 
                dataSource={segmentData} 
                rowKey='id'
            />
        </Card>
    )
    const StageTable = () => (
        <Card title="Stages">
            <Table
                pagination={true}
                columns={clientColumns} 
                dataSource={stageData} 
                rowKey='id'
            />
        </Card>
    )
    const TypeTable = () => (
        <Card title="Types">
            <Table
                pagination={{ pageSize: 3 }}
                columns={clientColumns} 
                dataSource={typeData} 
                rowKey='id'
            />
        </Card>
    )
    const CategoryTable = () => (
        <Card title="Categories">
            <Table
                pagination={{ pageSize: 3 }}
                columns={clientColumns} 
                dataSource={categoryData} 
                rowKey='id'
            />
        </Card>
    ) 

    return (
        <div>
            <Row gutter={16}>
				<Col xs={24} sm={24} md={24} lg={8} xxl={6}>
					<ClientTable />
				</Col>
				<Col xs={24} sm={24} md={24} lg={8} xxl={6}>
					<LanguageTable />
				</Col>
                <Col xs={24} sm={24} md={24} lg={8} xxl={6}>
					<ProductTable />
				</Col>
			</Row>
            <Row gutter={16}>
                <Col xs={24} sm={24} md={24} lg={8} xxl={6}>
					<SegmentTable />
				</Col>
				<Col xs={24} sm={24} md={24} lg={8} xxl={6}>
					<StageTable />
				</Col>
				<Col xs={24} sm={24} md={24} lg={8} xxl={6}>
					<TypeTable />
				</Col>
			</Row>
            <Row gutter={16}>
                <Col xs={24} sm={24} md={24} lg={24} xxl={6}>
					<CategoryTable />
				</Col>
            </Row>
        </div>
    )
}

